	if(this._map)
	{
		
		var context_fn = arguments.callee,
			q = context_fn.query||[],
			c   = this._map.getContainer(),
			sc  = c.style.cursor||'default',
			scs = !end?'progress':'default',
			i;
		
		context_fn.query=q;
		
		if(!end){
			if(q.indexOf(this)<0)
				q.push(this)
		}
		else {
			if((i=q.indexOf(this))>=0)			
				q.splice(i,1)			
		}
		
		if(sc!=scs)
		{			
			if((end&&q.length==0)||!end)			
				c.style.cursor = scs;
		}
	}
