var rosreestrLayer = new L.wmsLayer('http://c.maps.rosreestr.ru/arcgis/rest/services/Cadastre/Cadastre/MapServer/export?',
{
	loading:loading,
	fn_custom:
	function(params){
			
			var p=
			{ 
				transparent:true,
				bbox:params.bbox,
				dpi:'96',
				f  :'image',
				format:'PNG32',
				bboxSR:'102100',
				imageSR:'102100',
				size:[params.width,params.height].join(',')
			};
			
			return p;
		},
	//fadeTime:1000,
	//ignoreEmpty:true,
	ignoreFeatureInfo:true,
	proxy_url:'http://xs-msv:81/services/proxy',
	opacity:0.55,
	transparent:true,
	errorImg_url:'data:image/png; base64,'
});


var rosreestrLayerSelect = new L.wmsLayer('http://maps.rosreestr.ru/arcgis/rest/services/Cadastre/CadastreSelected/MapServer/export?',
{
	loading:loading,
	fn_custom:
	function(params){
		
			if(!map.hasLayer(rosreestrLayer))
				return;
			
			if(!this._cadNums||this._cadNums.length<=0)
				return;
			
			
			function normalizeCadNum(cadNum){ return cadNum.replace(/\x20/g,'').replace(/\:(0{0,})(\d+)/g,':$2'); }
						
			var strCadNums='';
			for(var c=0;c<this._cadNums.length;c++) {
				strCadNums += (strCadNums.length>0?',':'')+'\''+normalizeCadNum(this._cadNums[c])+'\'';
			}
			
			var p=
			{ 
				transparent:true,
				bbox:params.bbox,
				dpi:'96',
				f  :'image',
				format:'PNG32',
				bboxSR:'102100',
				imageSR:'102100',
				size:[params.width,params.height].join(','),
				layers:'show:1',
				layerDefs:'{"1":"PARCEL_ID in ('+strCadNums+')"}'
			};		
				
			return p;
		},
	fadeTime:80,
	ignoreFeatureInfo:true,
	proxy_url:'http://xs-msv:81/services/proxy',
	opacity:0.55,
	errorImg_url:emptyImage,
	transparent:true	
});
rosreestrLayerSelect.addKadastrNo=function(cadNum){
	this._cadNums=this._cadNums||[];	
	this._cadNums.push(L.Util.trim(cadNum));
	if(map.hasLayer(rosreestrLayer)&&!map.hasLayer(this))
		map.addLayer(this);
};
rosreestrLayerSelect.clearKadastrNo=function(cadNum){
	if(this._cadNums){	
		
		this._cadNums.splice(0,this._cadNums.length);
		if(this._cadNums.length==0)
			map.removeLayer(this);
	}
};
rosreestrLayerSelect.removeKadastrNo=function(cadNum){
	if(this._cadNums){
		var i=this._cadNums.indexOf(cadNum);
		if(i>=0)
			this._cadNums.splice(i,1);
		if(this._cadNums.length==0)
			map.removeLayer(this);
	}
};




