map.on('searchcomplete',function(e){	
		if(e.mapObjects)
			for(var i=0;i<e.mapObjects.length;i++){
				if(e.mapObjects[i]&&e.mapObjects[i].kadastrNo)
					rosreestrLayerSelect.addKadastrNo(e.mapObjects[i].kadastrNo);
			}
});
map.on('overlayadd overlayremove',function(e){
		
	if(!map.hasLayer(rosreestrLayer))
		map.removeLayer(rosreestrLayerSelect);
	else
		map.addLayer(rosreestrLayerSelect);					
});

map.on('removeselectcadnum',function(e){
	if(e.cadNum)
		rosreestrLayerSelect.removeKadastrNo(e.cadNum);
});

